--Creating a new table 
CREATE TABLE SumaxSalesReport2022 (
		OrderItemId INT,
		Price INT,
		LogisticStatus VARCHAR(255),
		OrderItemStatus VARCHAR(255),
		TransactionType VARCHAR(255),
		TransactionAmount INT
);

DROP TABLE SumaxSalesReport2022
SELECT * FROM SumaxSalesReport2022
--INSERTING INTO DATA INTO THE TABLE 



---Check out the total sales 
Select DISTINCT(OrderItemId), SUM(price) OVER (PARTITION BY Price)TotalSalesFor2022 
FROM SumaxSalesReport2022
WHERE LogisticStatus = 'Delivered to customer'

--Checking the total Return Orders
Select DISTINCT(OrderItemId), SUM(price) OVER (PARTITION BY Price)TotalReturnedFor2022 
FROM SumaxSalesReport2022
WHERE OrderItemStatus = 'returned'


